import React from 'react';
const Filter = () => {
    return (
        <div>
            <div>
                <div className="form-group">
                <label htmlFor="specificDate">Pick a date</label>
                <input type="date" className="form-control m-1" id="specificDate"/>
                </div>
                <label htmlFor="period">Choose period</label>
                <div className="form-group row">

                <label htmlFor="periodm mx-2">6 months</label>
                    <input type="Radio" name="period" value="6" id="period"/>
                </div>
            </div>
        </div>
    );
}

export default Filter;
